webpackJsonp([0x7415bcd4a710],{3393:function(t,n){t.exports={data:{markdownRemark:{html:"<p><strong>🌡21℃ 🌦</strong></p>\n<p>今日は一日中母の内職の手伝いをしていました。\nゴム人形を小袋に封入する作業です。\n一緒に地図の書いてある小さな紙を入れるのですが、これを何度も忘れて大変でした。</p>\n<p>その作業をしていたら S 君と、珍しく H 君が遊びに来たので、公園に行きました。\nしかし間が悪く夕立になって来たので、家に戻りファミコンで遊びました。</p>\n<p>その後夕飯は皆でレストランに行きました。\n皆での会食はとても美味しいです。</p>",frontmatter:{cover:null,date:"1990-10-07T21:00:00+09:00",strDate:"1990/10/7",title:"日記"}}},pathContext:{path:"/ja/blog/1990/10/07-diary/",langKey:"ja"}}}});
